import './App.css';
import Header from "./components/Header";
import Footer from './components/Footer'
import ScatterPlot from './components/ScatterPlot'
import InfoTable from './components/InfoTable'
import { Container } from "@material-ui/core";

function App() {
  return (
    <div className="App">
      <Header/>
      <Container>
        <ScatterPlot/>
        <InfoTable/>
      </Container>
      <Footer/>
    </div>
  );
}

export default App;
